<p dir="auto"><a href="https://github.com/csstools/postcss-plugins/tree/main/plugins/postcss-selector-not">PostCSS Selector Not</a> transforms :not() W3C CSS level 4 pseudo classes to :not() CSS level 3 selectors following the <a href="https://www.w3.org/TR/selectors-4/#negation-pseudo" rel="nofollow">Selectors 4 Specification</a>.</p>
